import React ,{Component} from 'react'

class Rectangle extends Component {
    state = { 
        width: 0,
        height: 0
     } 

     constructor(props){
         super(props);
         this.setState({width: this.props.width, height: this.props.height}); 
     }
    render() { 
        return (
            <div className="test"></div>
        );
    }
}

export default Rectangle;
